import React, { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import Form from 'react-bootstrap/Form';

const UpdateModal = ({ id, team, setError, pokemons, teams, setTeams }) => {
  const [show, setShow] = useState(false);
  const handleShow = () => setShow(true);

  const handleClose = () => {
    updateTeam(protoTeamBuilder(team), id);
    setShow(false);
  };

  const defaultState = {
    name: '',
    speciesToRemove: '',
    speciesToAdd: '',
  };

  const [inputState, setInputState] = useState(defaultState);

  const handleInputChange = (input, value) => {
    const newInputState = { ...inputState, [input]: value };
    setInputState(newInputState);
  };

  const updateTeam = async (team, id) => {
    try {
      const updatedTeam = await fetch(
        `http://localhost:8080/api/v1/teams/${id}`,
        {
          method: 'PUT',
          headers: {
            'Content-type': 'application/json',
          },
          body: JSON.stringify(team),
        }
      );
      const newTeams = teams.filter((t) => t.id !== id);
      setTeams(newTeams.push(updatedTeam));
    } catch (e) {
      setError(e);
    }
  };

  const protoTeamBuilder = () => {
    const newTeamMembers = [];
    const speciesToRemoveArray = inputState.speciesToRemove.split(',');
    const SpeciesToAddArray = inputState.speciesToAdd.split(',');

    team.members.forEach((member) => {
      speciesToRemoveArray.forEach((species) => {
        if (member.species !== species.toUpperCase()) {
          newTeamMembers.push(member);
        }
      });
    });

    SpeciesToAddArray.forEach((species) => {
      pokemons.forEach((pokemon) => {
        if (pokemon.species === species.toUpperCase()) {
          newTeamMembers.push(pokemon);
        }
      });
    });

    const newTeam = {
      name: inputState.name !== '' ? inputState.name : team.name,
      members: newTeamMembers,
    };
    console.log(newTeam);
    return newTeam;
  };

  return (
    <>
      <Button
        onClick={handleShow}
        className='d-flex justify-content-between m-2'
        variant='primary'
        id='delete'>
        <i className='fa fa-gear' />
      </Button>

      <Modal show={show} onHide={handleClose}>
        <Modal.Body>
          <Form.Group className='mb-3' controlId='name'>
            <Form.Control
              type='text'
              value={inputState.name}
              placeholder='Enter the team name'
              onChange={(event) => {
                handleInputChange(event.target.id, event.target.value);
              }}
            />
          </Form.Group>

          <Form.Group className='mb-3' controlId='member01'>
            <Form.Control
              type='text'
              value={inputState.member01}
              placeholder='Enter a pokemon name'
              onChange={(event) => {
                handleInputChange(event.target.id, event.target.value);
              }}
            />
          </Form.Group>

          <Form.Group className='mb-3' controlId='member02'>
            <Form.Control
              type='text'
              value={inputState.member02}
              placeholder='Enter a pokemon name'
              onChange={(event) => {
                handleInputChange(event.target.id, event.target.value);
              }}
            />
          </Form.Group>

          <Form.Group className='mb-3' controlId='member03'>
            <Form.Control
              type='text'
              value={inputState.member03}
              placeholder='Enter a pokemon name'
              onChange={(event) => {
                handleInputChange(event.target.id, event.target.value);
              }}
            />
          </Form.Group>

          <Form.Group className='mb-3' controlId='member04'>
            <Form.Control
              type='text'
              value={inputState.member04}
              placeholder='Enter a pokemon name'
              onChange={(event) => {
                handleInputChange(event.target.id, event.target.value);
              }}
            />
          </Form.Group>

          <Form.Group className='mb-3' controlId='member05'>
            <Form.Control
              type='text'
              value={inputState.member05}
              placeholder='Enter a pokemon name'
              onChange={(event) => {
                handleInputChange(event.target.id, event.target.value);
              }}
            />
          </Form.Group>

          <Form.Group className='mb-3' controlId='member06'>
            <Form.Control
              type='text'
              value={inputState.member06}
              placeholder='Enter a pokemon name'
              onChange={(event) => {
                handleInputChange(event.target.id, event.target.value);
              }}
            />
          </Form.Group>
        </Modal.Body>
        <Modal.Footer>
          <Button variant='primary' onClick={handleClose}>
            Update
          </Button>
        </Modal.Footer>
      </Modal>
    </>
  );
};

export default UpdateModal;
